    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "icon-id": {
            "type": "string"
        }
    },
    "_viewModelId": "AwIcon",
    "_uniqueViewModelId": "AwIcon",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, AwIconRenderFunction, {"useMemo":true}, ctxImportObj );

export default Component;
